import React from 'react';


const Practice = ({city, search, setSearch}) => {
    return (
        <>
          <div>
                <input 
                type="search" 
                placeholder="search city name"
                onChange={ (event) =>{ setSearch(event.target.value)  }}
                 />
            </div>

            <div>
                <h2>{search}</h2>
                <h3>{city.temp}</h3>
                <h3>min temp: {city.temp_min} and max temp: {city.temp_max}</h3>
            </div>
        </>
    )
}

export default Practice
